import logo from "./logo.svg";
import "./App.css";

function App() {
  const name = "엘리";
  const list = ["바나나", "사과", "오렌지"];
  return (
    <>
      <h1 className="orange">{`Hello! ${name}`}</h1>
      <h2>Hello!</h2>
      <p>{name}</p>
      <ul>
        {list.map((item) => (
          <li>{item}</li>
        ))}
      </ul>
    </>
  );
}

export default App;
